import React from 'react';
import Results from '../../components/Results/Results';

const car = (props) => {
    return (
        <div className='result card mt-2'>
            <div className="card-body">
                <h5 className="result-name card-title">{props.make} {props.model} ({props.year})</h5>
                <p className="result-description card-text"><a className="result-btn btn btn-dark" onClick={props.click}>Delete</a></p>
                <div>
                <Results results={props.issues} />
                </div>
            </div>
        </div>
    )
}

export default car;
